import React, { useEffect, useState } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import {
  collection,
  getDocs,
  query,
  where
} from 'firebase/firestore';
import { db } from '../firebase';
import '../styles/StaffDashboard.css';

function StaffDashboard() {
  const location = useLocation();
  const navigate = useNavigate();
  const staff = location.state?.staff;

  const [category, setCategory] = useState('');
  const [appliedData, setAppliedData] = useState([]);

  const predefinedCategories = [
    'Complaints',
    'Certificate',
    'Financial Support',
    'Customer Grievance',
    'Water Connection',
    'Electricity',
    'Housing Scheme'
  ];

  useEffect(() => {
    if (!staff) {
      navigate('/staff-login');
    }
  }, [staff, navigate]);

  const handleCategoryChange = async (e) => {
    const selectedCategory = e.target.value;
    setCategory(selectedCategory);

    try {
      // Fetch applications of the selected category
      const appSnap = await getDocs(
        query(collection(db, 'applications'), where('category', '==', selectedCategory))
      );

      const applicationsMap = {};
      appSnap.forEach(doc => {
        applicationsMap[doc.id] = doc.data();
      });

      // Fetch all applied entries
      const appliedSnap = await getDocs(collection(db, 'Applied'));

      const matched = [];
      for (const docSnap of appliedSnap.docs) {
        const applied = docSnap.data();
        const app = applicationsMap[applied.applicationId];

        // Only show if not yet verified
        if (app && applied.verify !== true) {
          matched.push({
            id: docSnap.id,
            applied,
            application: app
          });
        }
      }

      setAppliedData(matched);
    } catch (err) {
      console.error(err);
      alert('Error fetching applications.');
    }
  };

  if (!staff) return null;

  return (
    <div className="staff-dashboard">
  <h2>Welcome, {staff.name}</h2>
  <p><strong>Email:</strong> {staff.email}</p>
  <p><strong>Phone:</strong> {staff.phone}</p>

  <div className="category-select">
    <label>Select Category: </label>
    <select value={category} onChange={handleCategoryChange}>
      <option value="">-- Select Category --</option>
      {predefinedCategories.map((cat, idx) => (
        <option key={idx} value={cat}>{cat}</option>
      ))}
    </select>
  </div>

  {appliedData.length > 0 && (
    <div className="applications-list">
      <h3>Applications in "{category}"</h3>
      {appliedData.map((item, index) => (
        <div key={index} className="application-card">
          <p><strong>Applicant ID:</strong> {item.applied.userId}</p>
          <p><strong>Application:</strong> {item.application.name}</p>
          <p><strong>Message:</strong> {item.applied.message}</p>
          <button onClick={() =>
            navigate('/viewapp', {
              state: {
                applied: item.applied,
                application: item.application,
                appliedId: item.id,
                staffId: staff.id
              }
            })
          }>
            View
          </button>
        </div>
      ))}
    </div>
  )}

  <button onClick={() => navigate('/')} className="logout-button">
    Logout
  </button>
</div>
  );
}

export default StaffDashboard;
